 for 30 minutes Use a sandpaper or steel wool to scrape out all the rust.";i:27;s:31:"Clean the area with some water.";i:28;s:43:"Rust can be frustrating but it does happen.";i:29;s:152:"Even newer doors can show signs of rust which might make you question why in the world you spent so much money on that extra coat of high-quality paint.";i:30;s:50:"Of course regardless of age there are a number of.";i:31;s:161:"Cleaning your steel garage door at least twice a year will reduce rust and the need to repaint especially in snow-prone areas where salt is used on the roadways.";i:32;s:92:"After cleaning youll want to apply a coat of wax to help your steel garage door last longer.";i:33;s:77:"Aluminum garage doors wont rust but they do tend to show every ding and dent.";i:34;s:123:"Along with lubricants wax also works as a protective barrier to prevent rust from forming on the finish of the garage door.";i:35;s:138:"The wax can prevent salt from coming in contact with the garage door parts and can prevent excess grime or dirt from developing over time.";i:36;s:54:"One is a double door and the other 2 are single doors.";i:37;s:60:"Each door is made of steel and has an automatic door opener.";i:38;s:69:"Where the panels align on the doors small pits of rust are appearing.";i:39;s:53:"The doors are white and this is beginning to show up.";i:40;s:102:"I have contacted the manufacturer and no response as to how to repair or stop the rust from appearing.";i:41;s:68:"To put it simple the door should open away from you not towards you.";i:42;s:130:"If the door opens towards you the weak side is in front of you if the door opens away from you the strong side is in front of you.";i:43;s:84:"For example the front-door on your base should swing into the base and not outwards.";i:44;s:82:"One of the biggest problems for the steel garage door panels and hardware is rust.";i:45;s:42:"It affects not only the looks of the door.";i:46;s:97:"It reduces the strength and durability of the metal components and makes the system much noisier.";i:47;s:45:"At the same time it is perfectly possible to.";i:48;s:47:"There are several ways to remove doors in RUST.";i:49;s:24:"Using a Building Hammer.";i:50;s:27:"Using Fire and Cheap Tools.";i:51;s:50:"Using Satchels and Timed Charges C4 Using Rockets.";i:52;s:45:"Remove doors in RUST using a building hammer.";i:53;s:50:"So youve decided to change up things in your base.";i:54;s:195:"1- Close the electricity from your opener first then start cleaning the panel of the garage door with water and liquid dish soap formulated especially for grease to remove oil and dirt from door.";i:55;s:85:"2- Dip an old cloth in white vinegar and wipe a steel wool pad over the rusted areas.";}}